(202, 9, 'Motorbreath (Exotic)', 'Concentrates', '', '', 'Q60, 110h, 200o, 2+', 'IndicaConcentrates', 'This rippin Indica hybrid is a cross between the classic Chem D x SFV OG Kush strains. Its potent flavor and high will fill you have you soaring. Discounted price just because. As always no flash!', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-dIzqvnygDfGhjcozkp9wvYfr43GJSdbwux1lYKbP.jpeg'),
(203, 9, 'Bahama Berry (Exotic+)', 'Flower', '', '', 'q70, h120, o220, 2+', 'IndicaFlower', 'This hard to find, fresh, and frosty Indica dominant smoke is a well-designed cross between Strawberry Jelly x Bahama Mama. Perfect for treating mood disorders, chronic pain, inflammation, depression, stress, anxiety, and insomnia/sleep disorders.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-Py9oXkdjBFM1LRuuYMQTUQ6ax5PEZR34cVKkTkAT.jpg'),
(204, 9, 'Flo aka DJ Short Flo (Indoor+)', 'Flower', '', '', 'q60,h100,o180,2+disc', 'SativaFlower', 'This modified sativa dominant hybrid is known for its medicinal properties and is an improved version of the strain that won the 1996 Cannabis Club award. It’s a super famous lovechild of OGs, Purple Thai x Afghani Indica.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-avhQSTlWAh6g23iZ7pXnYLOygbmSaprS3exj2SdP.jpg'),
(205, 9, 'AP Pharms (1G Distillate)', 'Concentrates', '', '', '1/35,2/65,4/120, 5+ disc', 'HybridConcentrates', 'These are real single source disty carts from a small farm we work with up north. They are some of the highest quality distillate carts you can get, taste great, and have legit terps. These are a favorite among cart smokers.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-A9WTBzjZUqkpjMOiwMbMBqUSj9SEImfFzDdAIKcu.jpg'),
(206, 9, 'High Rocket Cart (1G Disposable)', 'Concentrates', '', '', '1-3@35ea,4/125, 5+ disc', 'HybridConcentrates', 'These are awesome with 10 quality  strain options. These disposable pods are high quality and super discreet. These are a small brand, not cheap knock offs. We’ve been carrying them for years, and are a great distillate option.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-adKzxBERqn4vePB9jsJfu1nPt1E1HEPmbgW3v8GY.jpg'),
(207, 9, 'Ice Cream Cake (Dep)', 'Concentrates', '', '', 'q50,h90,o150,2o270,4o400', 'IndicaConcentrates', 'This 75/25 indica dominant hybrid is a cross between Gelato 33 x Wedding Cake with the classic ICC nose. Great for treating depression, insomnia, chronic pain, and nausea/appetite loss.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-wFIJbNliFRLPlS2Y2tMuS1oqwmbjZ7viFqb4cS3j.jpg'),
(208, 9, 'Gelato41 (Indoor)', 'Flower', '', '', 'q50,h90,o150, 2/270,4/400', 'HybridFlower', 'This slightly sativa hybrid is a popular cross between Thin Mint Girk Scout Cookies x Sunset Sherbert. Great for treating ADD/ADHD, depression, chronic stress, headaches/migraines, and nausea.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-eXnhHUIA3CNRXAY2CCWBdVDLLVUIvkeEaDKui9Ww.jpg'),
(209, 9, 'Strawberry Cough', 'Flower', '', '', 'q80, h140, o240, 2+', 'SativaFlower', 'This is the best strawberry cough you will probably see in your entire life. This sativa dominant hybrid is a cross between Haze x Strawberry Fields', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-nZ0qB42BrvFAvG3UwnQ6yL5gXRgUdqLsa4ywfrVZ.jpg'),
