(212, 9, 'Prerolls (1.2G - Exotic+)', 'Concentrates', '', '', '1/10, 10/90', 'IndicaConcentrates', 'These are hand-made out of fresh nugs from our top packs. These are high quality and fresh prerolls. We have 4-6 options available.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-1MDcPSAYmS3DKwvOrAHbDrI4V3b5VwwAvZkApoN5.jpg'),
