(214, 9, 'Secret Weapon (Exotic)', 'Flower', '', '', 'q60,h110,o210,2+ disc', 'SativaFlower', 'This potent hybrid heater is an action packed cross between White Widow x Cheese Quake. It’s a well-balanced and potent high that hits you with heavy euphoria and cerebral lift.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-WwLA2bAFCysC872L4YkaI2k6L0XGgmkJWvkaa5aa.jpg'),
(215, 9, 'Titty Sprinkles (Exotic)', 'Concentrates', '', '', '7g70, 14g120, 28g 220,2+', 'IndicaConcentrates', 'This awesome cross between Grease Monkey x Purple Punch 2.0, and has delicious spicy diesel meets fruity terps.Excellent for treating arthritis, anxiety, chronic pain, depression, insomnia, and stress. \n💰 q70,h120,o220,2+ disc', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-nW9GJlUkPjUtCm91twj7oGxtCWnqSiaOswacQDXh.jpg'),
(216, 9, 'Goofiez (Microdiamonds)', 'Concentrates', '', '', '2g70, 4g120, 7g+ discount', 'IndicaConcentrates', 'This roaring and terpy cross between Apples and Bananas x Jokerz is an intense hybrid with super high avg THC levels clocking well over 30%.\n🧑‍⚕️ Perfect for treating bipolar disorder, depression, fatigue, stress, and anxiety. \n💰 2for70, 4for120, 7', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-MgQjHPAw3GbkMwScIvmNYTsqQXDvgzHje9DlyEa1.jpg'),
(217, 9, 'Blue Nerdz (Badder/Crumble)', 'Concentrates', '', '', '2g50, 4g80, 7g+ discount', 'HybridConcentrates', 'NO CRC, Nug run badder. Best type of badder money can buy. Forbidden Fruit x Watermelon Zruit x Watermelon Z.\n👨‍⚕️ Excellent at treating ADD/ADHD, chronic pain, arthritis, depression, stress, and anxiety. \n💰 2for50, 4for90, 7+ discount.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-hzk8bDhWED6J1xmBr5wZixTypBedl7PLXonMOFIy.jpg'),
(218, 9, 'Black Mamba 🐍 (Indoor+)', 'Flower', '', '', '70q,120h,220o,2+ disc', 'IndicaFlower', 'Black Mamba 🐍 (Indoor+) - This heavy Indica hybrid has a great nose and nugs, and bred off genetics from the Domania and Blueberry strain families. This strain has a powerful relaxing body high that will have you feeling good and completely relaxed.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-ILLq6Gml7Uyn7aqZ0G6jrOhVtt6c04B46mDUrmDb.jpeg'),
(219, 9, 'Space Cubes (300MG)', 'Edible', '', '', '1for25,2for45,3+ discount', 'IndicaEdible', 'This bags contain 10, 30mg gummy edibles. These are high quality, medically dosed gummies. They hit like a tank, and are a perfect end of day treat.  They our are most requested edible by far.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-fh2zSRNKBV2rkuU4NnUxq3vWkkmgJlhfMTaiFuZ6.jpg'),
(220, 9, 'Chem Chillz (Exotic+)', 'Flower', '', '', '80/q,150/half/260whole', 'IndicaFlower', 'Chem Chillz 🧪 (Exotic+) - This boutique strain is a cross between two modern headliners, GMO x Chillz. Perfect nugs and a sweet, pungent, and a touch of skunky nose. 10/10', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/LeafedOut-KPNYJWj7itPpxuw8fXeSh5pruCJfgOL7TSD4vNYY.jpeg'),
(221, 9, 'Cheetah 🐆 Piss (Microdiamonds)', 'Concentrates', '', '', '45/g, 2 for 80', 'HybridConcentrates', 'Cheetah 🐆 Piss (Microdiamonds) - This homage to ‘Cat Piss’ is a 50/50 hybrid with a potent high and great nose 👃. The perfect toke for knocking out your to-do list in a state of happy, euphoric, bliss. Great for gettin shit done.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/Leafedin_CNbvFXo7UYQr4xe039FPMz1zSberDQrehwc1VjXa.jpeg'),
(222, 9, 'Mimosa (Live Badder)', 'Concentrates', '', '', 'Badder', 'SativaConcentrates', 'Mimosa 🍊 (Live Badder) - This 70/30 sativa dominant hybrid has great orange terps and a great crumble-like structure. The perfect time for chasing sleep away with positive, motivated, euphoric energy.', 'https://leafedout.com/storage/usercontent/pp/LeafedOutQk4NtvJUd4iznnerplUpTJPH6vctBBUQbZvfZJmC.v1645215561.jpeg, https://leafedout.com/storage/usercontent/photos/Leafedin_qn6HkX544vTSedoEBTTcrbBcgLVHbuA1fb5Gtoes.jpeg');
